I love discovering new brands, check out some of the new products to hit my self. @kitaomatchausa is a Japanese line that uses organic matcha, chia seeds and açaí.  The winner product for me is the Matcha & Chia exfoliation gel, pores look tighter and the skin is left brighter. 
@spasciences makes some of the best and most affordable beauty tools I love the Nova cleansing brush and just added the Cirra beauty steamer. 
Winter is here and we need to help keep our hands extra hydrated. @costabrazil is packed full of their vitamin-dense Jungle Complex of Kaya, Cacay and Breu, as well as hydrating Squalane for skin that’s soft and smooth. ❤️❤️❤️

Today is one of my favorite days of the year. It’s drop off day for my Beauty Cares charity, with the help of my elves Greyson and Bexley we dropped off some holiday cheer at @cbreastfriends and @rmhclt I can’t thank the brands and PR teams enough for their kindness and generosity every year. Also I want to thank you for supporting me and allowing me to giveback this way, I truly appreciate it. I hope the season of giving and the magic 🪄 of Christmas fills your life with joy and happiness. XO Matt 🎄
